$(function() {
	// Global initiator for all Select2 elements
	$('.initiate-select2').each(function(index, object) {
		$(object).select2({
			theme: 'adtech',
			minimumResultsForSearch: Infinity,
			placeholder: $(object).data('placeholder')
		});
	});

	// Range input before & after color track
	document.querySelectorAll('.__range').forEach(function(el) {
		el.oninput = function() {
			var valPercent = (el.valueAsNumber - parseInt(el.min)) / (parseInt(el.max) - parseInt(el.min));
			var style = 'background-image: -webkit-gradient(linear, 0% 0%, 100% 0%, color-stop(' + valPercent + ',' + rgb2hex($(el).css('border-left-color')) + '), color-stop(' + valPercent + ', #fff));';
			el.style = style;
		};
		el.oninput();
	});

	// Focus input-group-append on input-focus
	$('.input-group > input')
		.focus(function(e) {
			$(this)
				.parent()
				.addClass('input-group-focus');
		})
		.blur(function(e) {
			$(this)
				.parent()
				.removeClass('input-group-focus');
		});
});

// Fix select2 not working in modal
$.fn.modal.Constructor.prototype._enforceFocus = function() {};

// keep default js alert to use in specific cases
window.legacyAlert = window.alert;

// types alert and confirm: "success", "error", "warning", "info", "question". Default: "warning"
// overwrite default js alert
window.alert = function(msg, title, type, params, cb) {
	var title = title == null ? 'Alert' : title;
	var type = type == null ? 'warning' : type;
	Swal.fire(
		$.extend({
				title: title,
				text: msg,
				icon: type
			},
			params || {}
		)
	).then(result => {
		if (cb) {
			cb(result);
		}
	});
};

// keep default js alert to use in specific cases
window.legacyConfirm = window.confirm;

window.confirm = function(msg, title, type, onConfirm, onCancel, params) {
	var title = title == null ? 'Confirm' : title;
	var type = type == null ? 'warning' : type;
	Swal.fire(
		$.extend({
				title: title,
				text: msg,
				icon: type,
				showCancelButton: true,
				allowEscapeKey: false,
				allowOutsideClick: false
			},
			params || {}
		)
	).then(
		function(isConfirm) {
			if (isConfirm && isConfirm.value && onConfirm instanceof Function) {
				onConfirm();
			}
		},
		function(dismiss) {
			if (dismiss === 'cancel' && onCancel instanceof Function) {
				onCancel();
			}
		}
	);
};

$.rails.allowAction = function(link) {
	if (link.data('confirm') == undefined) {
		return true;
	}
	$.rails.showConfirmationDialog(link);
	return false;
};

$.rails.showConfirmationDialog = function(link) {
	var message = link.data('confirm');
	Swal.fire({
		title: 'Confirm',
		text: message,
		icon: 'warning',
		showCancelButton: true
	}).then(function(e) {
		if (e.value == true) {
			$.rails.confirmed(link);
		}
	});
};

$.rails.confirmed = function(link) {
	link.data('confirm', null);
	link.trigger('click.rails');
};

// RGB to HEX converter
function rgb2hex(rgb) {
	let regex = rgb.match(/^rgb\((\d+),\s*(\d+),\s*(\d+)\)$/);
	return '#' + ('0' + parseInt(regex[1], 10).toString(16)).slice(-2) + ('0' + parseInt(regex[2], 10).toString(16)).slice(-2) + ('0' + parseInt(regex[3], 10).toString(16)).slice(-2);
}
